window.bookSummaryJSON = "<p>In this entertaining and inspirational memoir, Hollywood legend Dick Van Dyke shares his secret to staying resilient in old age. </p> <p>Beloved Hollywood icon Dick Van Dyke will celebrate his 90th birthday in December 2015. He's an established legend, having starred in <i>Mary Poppins</i>, <i>Chitty Chitty Bang Bang</i>, <i>and The Dick Van Dyke Show</i>. And yet he's still keeping himself busy, entertaining America on television, in movies, on the stage, and on social media. Everyone wonders, \"How does he do it?\" For the first time, Van Dyke shares his secrets and tips on old age - just keep moving. </p> <p>With a fun and folksy way of addressing its audience, <i>Keep Moving</i> serves as an instruction audiobook on how to embrace old age with a positive attitude. The chapters are filled with exclusive personal anecdotes that explore various themes on aging: how to adapt to the physical and social changes, deal with loss of friends and loved ones, stay current, fall in love again, and \"keep moving\" every day like there's no tomorrow. </p>"; 
